import React from "react";


class Room extends React.Component {
  componentDidMount() {
    const { location } = this.props;
    console.log(location.state);
  }
  render() {
    return (
      <div>
        <h1>OrchestLive!</h1>
        <div className="call">
          <h1>Room Name : {storedRoom}</h1>
          <h3>Client : {storedUser}</h3>
          <div className="myStream">
            <video 
              className="myFace" 
              autoPlay
              playsInline
              width="400" 
              height="400"/>
            <button className="mute">Mute</button>
            <button className="camera">Turn Camera Off</button>
            <select className="cameras"/>
            <video 
              className="peerFace" 
              autoPlay
              playsInline
              width="400" 
              height="400"/>
          </div>
        </div>
      </div>
    );
  }
  
}

export default Room;
